import React, { Component } from 'react';
import { useState } from 'react';

export default function ComboBox({goal_url})
 {
    const [code_name, setcode_name] = React.useState(null);
    axios({
        // Endpoint to send files
        url: " http://localhost:5000/" + goal_url ,
        method: "GET" ,
        headers: {},
        })
        .then((res) => { useEffect(() => {
            (()=>{
                setcode_name(res.data);
            })();
          }, []);}) // Handle the response from backend here
        . catch ((err) => { alert ("все плохо")}); // Catch errors if any
      
        return (
            <div class="container ">
                
                <div class="row">
                    <div class="col-sm-3 mt-3">
                        <select class="form-control">
                        {code_name && code_name.map(({code,name}) => (
                            <option value={code}>{name}</option> ))}
                            
                        </select>
                    </div>
                </div>
            <br />
            </div>
        );
    }
